def move_name(cap_name):
    f = open('PBS/moves.txt', "r")
    line = 0
    for lines in f:
        try:
            line += 1
            #print(lines)
            if line < 3:
                continue
            lines = lines.strip('\n')
            datada = lines.split(',')
            internalname = datada[1]
            realname = datada[2]
            #print(internalname, cap_name, realname)
            if internalname == cap_name:
                return realname
        except Exception:
            continue


for __move in moves.MOVES:
    __movename = move_name(__move)
    #move_name(move)
    #continue
